import axios from "axios";
import auth_header from "./auth_header";

export const currentOrders = () => {
  return axios
      .get('localhost../customer/order',{ headers: auth_header() })
      .then((response) => {
        return response.data;
      });
};

export const pastOrders = () => {
  return axios
      .get('localhost../customer/', { headers: auth_header() })
      .then((response) => {
        return response.data;
      });
};
